import React from "react";
import { ResponsiveBullet } from '@nivo/bullet'


const data = [
  {
    "id": "temp.",
    "ranges": [
      24,
      76,
      15,
      0,
      120
    ],
    "measures": [
      67
    ],
    "markers": [
      104
    ]
  }
]


function MyResponsiveBullet(){
  return (
    <ResponsiveBullet
        data={data}
        margin={{ top: 50, right: 90, bottom: 50, left: 90 }}
        spacing={46}
        titleAlign="start"
        titleOffsetX={-70}
        measureSize={0.2}
        rangeColors="nivo"
        animate={true}
        motionStiffness={90}
        motionDamping={12}
    />
  )
}

export default MyResponsiveBullet;
